import React from 'react';
import ClinicCard from "./ClinicCard";
import api from "../../Re-usable/Api Url/apiURL";
import {webApiURL as webApiUrl} from "../../../Constants/URLConstants";

const ClinicsTable = ({clinics}) => {

    if (clinics.length === 0) {
        return <div className="clinicTable">
            <h2 className={"no-clinics"}>Please add clinics</h2>
        </div>
    }

    const deleteClinicMethod=async (clinicId)=>{

        try {
            const res = await api.get(webApiUrl.clinics.deleteClinic + clinicId);

        } catch (e) {

        }
    }



    return (
        <div className="clinicTable">

            {
                clinics.map(clinic => {
                    return <ClinicCard key={clinic.id} clinic={clinic}  />
                })
            }



        </div>
    );
};

export default ClinicsTable;
